<node CREATED="1687869717627" FOLDED="true" ID="ID_1347585042" MODIFIED="1687869723239" TEXT="frontend/src/app/windows/orderForm/order-form-delete/order-form-delete.component.ts">
<icon BUILTIN="list"/>
